import styled from "styled-components";
import { Button } from "./Button";

const StyledTable = styled.div`
  background: #bcff78;
  h1 {
    margin-left: 20px;
    margin-right: 20px;
    padding:10px;
    text-align: center;
    background: #fff;
    color: #ff96ad;
    border-radius: 40px;
  }
  input {
    border: none;
    border-radius: 20px;
  }
  .btn-editar {
    position: relative;
    bottom: 10px;
  }
`;
export function Table() {
  return (
    <StyledTable>
      <label>Seleccionar por fecha: </label>
